script: |
  super -f text -I q9831.spq | sort > q9831.out

inputs:
  - name: q9831.spq
    data: |
      SELECT ALL + col2 - + col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE col1 + + + col1 NOT IN ( - 66, 54, + 0 * + - col0 );
  - name: tab1

outputs:
  - name: q9831.out
    data: |
      -23
      -26
      45
